import React from 'react'
import './App.css';
import HomePage from '../Home/Home';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";


function App() {
  return (
    <main>
      <Router>
        <Routes>
          <Route exact path="/" render={HomePage} />
        </Routes>
      </Router>
    </main>
  );
}

export default App;
